import { GuitarTab } from '../GuitarTab/GuitarTab';

export function GuitarTabsList({ chord: { positions, key, suffix } }) {
  console.log(key, suffix);
  return (
    <div className="tabs_list">
      <h2>{key}</h2>
      {positions.map((pos) => (
        <GuitarTab position={pos} />
      ))}
    </div>
  );
}
